import React from 'react';


class MovieList extends React.Component{

    render(){
        return(
                <div className="row">
                    <div className="col-lg-4">
                        <div className="card mb-4 shadow-sm">
                            <img src="https://image.tmdb.org/t/p/w600_and_h900_bestv2/qCPMjT8Ld8tvs1zs7LY2jpKlRIK.jpg" className="card-img-top" alt="Movie image"/>
                            <div className="card-body">
                                <h5 className="card-title">Sample Movie</h5>
                                <p className="card-text">Sample Movie Description</p>
                                <div className="d-flex justify-content-between align-items-center">
                                    <button className="btn btn-md btn-outline-danger" type="button">Delete</button>
                                    <span className="badge badge-info">9.0</span>
                                
                                
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
        )
    }
}

export default MovieList
